import React from 'react'
import photo from '../images/Henuja.jpg'


export default function NavBar(){
    return (
    <nav>
        <img src={photo}
            alt='Henuja'
            className='HenujaPhoto' />
            <h1>Henuja Dulneth Katuwapitiya</h1>
            <p>Student in SLIITA</p>
        
    </nav>

    )

    
}
